  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains sensitive biological
  resource data for submerged aquatic vegetation (SAV) in Northwest Arctic, Alaska.
  Vector polygons in this data set represent habitat distribution. Species-specific
  abundance, seasonality, status, life history, and source information are stored
  in relational data tables (described below) designed to be used in conjunction with
  this spatial data layer.This data set comprises a portion of the Environmental Sensitivity
  Index (ESI) data for Northwest Arctic, Alaska. ESI data characterize the marine
  and coastal environments and wildlife by their sensitivity to spilled oil. The ESI
  data include information for three main components: shoreline habitats, sensitive
  biological resources, and human-use resources.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
